// import { makeStyles } from "@material-ui/styles";
import { createUseStyles } from 'react-jss'

const useStyles = createUseStyles({
    icon: {
        position: "relative",
        bottom: 0,
        color: 'grey',
        padding: "1%",
        height: '100%',
        "&:hover": {
            color: 'black'
        }
    }
});

export default useStyles;
